export const LOGIN = '@auth/LOGIN';
export const LOGOUT = '@auth/LOGOUT';
export const REGISTER = '@auth/REGISTER';


export const increment = (score = 1) => ({
    type: 'INCREMENT',
    score
  });
  
  export const decrement = (score = -1) => ({
    type: 'DECREMENT',
    score
